{
    var sreturn = this;
    while (sreturn.length < nLength)
    {
        sreturn = String(sChar) + sreturn;
    }
    return sreturn;
}

//Replace the given character with the character entered
String.prototype.replaceAt = function (index, char)
{
    return this.substr(0, index) + char + this.substr(index + char.length);
}

//To calculate the number of days in a month
daysInMonth = function(iMonth, iYear)
{
	return 32 - new Date(iYear, iMonth, 32).getDate();
}

//To verify is it a valid Date
 isDate = function(txtDate)
{
    var objDate,  // date object initialized from the txtDate string
        mSeconds, // txtDate in milliseconds
        day,      // day
        month,    // month
        year;     // year

    // extract month, day and year from the txtDate (expected format is mm/dd/yyyy)
    // subtraction will cast variables to integer implicitly (needed
    // for !== comparing)
    month = txtDate.substring(0, 2) - 1; // because months in JS start from 0
    day = txtDate.substring(3, 5) - 0;
    year = txtDate.substring(6, 10) - 0;

    // convert txtDate to milliseconds
    mSeconds = (new Date(year, month, day)).getTime();
    // initialize Date() object from calculated milliseconds
    objDate = new Date();
    objDate.setTime(mSeconds);
    // compare input date and parts from Date() object
    // if difference exists then date isn't valid
    if (objDate.getFullYear() !== year ||
        objDate.getMonth() !== month ||
        objDate.getDate() !== day)
    {
        return false;
    }
    // otherwise return true
    return true;
}

isTextSelected = function(input)
{
    if (typeof input.selectionStart == "number")
    {
        return input.selectionStart == 0 && input.selectionEnd == input.value.length;
    } else if (typeof document.selection != "undefined")
    {
        input.focus();
        return document.selection.createRange().text == input.value;
    }
}

new function ($)
{
    $.fn.setCursorPosition = function (pos)
    {
        if ($(this).get(0).setSelectionRange)
        {
            $(this).get(0).setSelectionRange(pos, pos);
        } else if ($(this).get(0).createTextRange)
        {
            var range = $(this).get(0).createTextRange();
            range.collapse(true);
            range.moveEnd('character', pos);
            range.moveStart('character', pos);
            range.select();
        }
    }
}(jQuery)


